import React from "react";
import {BrowserRouter,Link,Switch,Route} from "react-router-dom";


export default function Routes(){
    return(
        <BrowserRouter>
            <switch>
                <Route path="/" exact component={Home}></Route>
            </switch>
        </BrowserRouter>
    )
}
